export default function StepsInfo() {
  const currentStep = 3;
  return (
    <div>
      <ul className="flex space-x-1">
        {[1, 2, 3, 4, 5].map((item, index) => {
          if (currentStep == index)
            return (
              <li
                key={item}
                className="w-[30px] h-[10px] rounded-full border border-neutrals-900"
              ></li>
            );

          return (
            <li
              key={item}
              className="w-[10px] h-[10px] rounded-full border border-neutrals-900"
            ></li>
          );
        })}
      </ul>
    </div>
  );
}
